여러분 지금 보시면 에리얼이 교회 출신이라 했습니다
여기에 주목해야 할 게 전편에 세례를 받으면 외계생물이 기생한다고 나와있고 아마 기생한 외계인의 복장에 따라 추기경, 사제, 주교로 나뉘는 것 같습니다 그리고 엘사또한 (본의 아니게) 세례를 받았고 에리얼이 기생했습니다 근데 기생한 에리얼의 복장은 흰색입니다 그러니까 지금 엘사는 D급의 몸을 가진 교황이라는 소리입니다;;;;
그러니까 이 만화는 지금 신을 대신하는 교황(그것도 단 1명밖에 없는)이 자기 엄마랑 친구 앗아갔다며 신에게 도전장을 내밀고 또한 지금 화에서 A급 신도가 겉모습 때문에 교황을 못알아보는 상태에서 교황에게 대들고 있는겁니다 여러분;;;;(엘사가 교황이라는 것을 알게되면 엘사 욕한 애들은 목이 날아가겠지....)
